	F_Identify varchar(12),
	F_CardKind varchar(16),
	F_Year varchar(10),
	F_FinishTime timestamp,
	F_CloseTime timestamp,
	F_Fax varchar(20),
	F_Address varchar(60),
	F_Mail varchar(100),
	F_CustomerId uuid,
	F_Info varchar(2000),
	F_Informa varchar(10000),
	F_DepartmentId varchar(10),
	U_ErrorCode varchar(20),
	U_PageStatus varchar(10),
	U_PageNum varchar(10),
	U_PageCode varchar(10),
	U_ErrorMemo varchar(100),
	F_CustomerId2 uuid,
	FCreateUserId uuid,
	FCreateDepartmentId uuid,
	FCreateTime timestamp,
	F_IDNumber varchar(15),
	F_Satisfy varchar(20),
	F_Remark varchar(200),
	F_Month varchar(50),
	F_Other varchar(200),
	U_AddressUnOfficial varchar(60)
);

create table TBBmCmonth (FEntityId uuid, FValue varchar(100));
create index IBBmCmonth1 on TBBmCmonth (FEntityId);
create index IBBmCmonth2 on TBBmCmonth (FEntityId, FValue);




